const tasks = [
  {
    title: "a",
    text: "lala",
  },
  {
    title: "b",
    text: "twotwo",
  },
];
const Tasks = () => {
  return (
    <div>
      {tasks.map((task) => (
        <h3 key={task.title}>{task.text}</h3>
      ))}
    </div>
  );
};

export default Tasks;
